import axios from 'axios';

class FreeBoardService {
	getBoardList=()=>{
		axios.get('/board',{
			params: {id:'he'}
		})
		.then(res=> {return res} )
		.catch(res=> {return res} );
	}
}

export default FreeBoardService;
